window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"27.2.0","implementation":{"name":"cucumber-jvm","version":"7.21.1"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"21.0.5+9-LTS-239"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1740288691,"nanos":117702100}}},{"source":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/01_Login.feature","data":"@Loginpage @LMS\r\nFeature: Login page validation\r\n\r\n  Background:\r\n    Given Admin launch the browser and Admin is in login Page\r\n\r\n  @Logincredentials\r\n  Scenario Outline: Validate login with valid and invalid credentials\r\n    When Admin enter valid \"<credentials>\"  and selects \"Admin\" from the dropdown  \r\n  And clicks the login button  \r\n    Then Admin should see the \"<result>\"\r\n    Examples:\r\n    | credentials              | result                  |\r\n    | valid credentials        | Admin should land on dashboard page             |\r\n    |invalid credentials        | Invalid username and password Please try again |\r\n    | onlypassword                 | Please enter your user name |\r\n    | onlyusername                 | Please enter your password  |\r\n    \r\n    @keyboardLogin\r\n Scenario: verify login button action through keyboard\r\n   When Admin enter valid credentials  and clicks login button through keyboard\r\n   Then Admin should land on dashboard page\r\n\r\n  @mouseLogin\r\n Scenario: verify login button action through mouse\r\n   When Admin enter valid credentials  and clicks login button through mouse\r\n   Then Admin should land on dashboard page\r\n\r\n    @spellcheck\r\n  Scenario: Verify the text spelling in the page\r\n    Then Admin should see correct spellings in all fields\r\n\r\n@LogoValidate\r\n  Scenario: Verify the company logo\r\n    Then Admin should see logo on the left  side\r\n\r\n  @AppNameValidate\r\n  Scenario:Verify application name\r\n    Then Admin should see  LMS - Learning Management System\r\n\r\n  @CompanyNameValidate\r\n  Scenario: Verify company name\r\n    Then Admin should see company name below the app name\r\n\r\n  @LoginLMSContent\r\n  Scenario: Validate sign in content\r\n    Then Admin should see \"Please login to LMS application\"\r\n\r\n  @CountTextField\r\n  Scenario: Verify text field is present\r\n    Then Admin should see two text field\r\n\r\n    @UserFirst\r\n  Scenario: Verify text on the first text field\r\n    Then Admin should \"User\" in the first text field\r\n\r\n    @asteriskUser\r\n  Scenario: Verify asterisk next to Admin text\r\n    Then Admin should see field mandatory asterisk symbol next to Admin text\r\n\r\n  @PasswordSecond\r\n  Scenario: Verify text on the second text field\r\n    Then Admin should \"Password\" in the second text field\r\n    \r\n    @Dropdown\r\n    Scenario: Verify dropdown is present\r\n  Then Admin should see one dropdown\r\n  \r\n    Scenario: Verify placeholder in dropdown to select role\r\n    \r\n    Then Admin should see \"select the role\" placeholder in the dropdown\r\n\r\n  Scenario: Verify dropdown option to select role\r\n    \r\n    Then Admin should see \"Admin, Staff, Student\" options in the dropdown\r\n\r\n  \r\n    @asteriskPassword\r\n  Scenario: Verify asterisk next to password text\r\n    Then Admin should see * symbol next to password text\r\n\r\n  Scenario: Verify the alignment input field for the login\r\n    Then Admin should see input field on the centre of the page\r\n\r\n    @loginButtonAvailable\r\n  Scenario: verify Login button is present\r\n    Then Admin should see login button\r\n\r\n  Scenario: Verify the alignment of the login button\r\n    Then Admin should see login button on the centre of the page\r\n\r\n    @userColor\r\n  Scenario:Verify input descriptive test in Admin field\r\n    Then Admin should see Admin in gray color\r\n\r\n  @passwordColor\r\n  Scenario: Verify input de cks login button\r\n    Then Admin should see the navigation bar text on the top right side\r\n    \r\n  @MenuOrder\r\n  Scenario Outline: Validate navigation bar order\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<Menu>\" in the \"<Order>\"\r\n\r\n    Examples: \r\n      |  Menu    | Order |\r\n      | Home     |   1   |\r\n      | Program  |   2   |\r\n      | Batch    |   3   |\r\n      | Class    |   4   |\r\n      | Logout   |   5   | \r\n      \r\n  @PieChart\r\n  Scenario: verify pie-chart presence\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see piechart\r\n    \r\n  @UsrDetail\r\n  Scenario: Verify user details\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see welcome message with user name and role \r\n       \r\n  @BarChart\r\n  Scenario: Verify bar chart\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see bar chart for Active and inactive user\r\n    \r\n  @LMSCount\r\n  Scenario Outline: Verify section count\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<Section>\" count\r\n\r\n    Examples: \r\n\r\n      |   Section  | \r\n      |   User     |\r\n      |   Staff    |\r\n      |   Batch    |\r\n      |   Program  |\r\n      \r\n  @PaginationIcon\r\n  Scenario: Verify staff table pagination\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see staff table with pagination icons\r\n    \r\n  @Staff5Data\r\n  Scenario: Verify staff data page split\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see five staff data in a page\r\n    \r\n  @LMSCount\r\n  Scenario Outline: verify page icon disable\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<PageArrow>\" page icon disabled\r\n\r\n    Examples: \r\n\r\n      |   PageArrow  | \r\n      |   Previous   |\r\n      |   FirstPage  |  \r\n      \r\n    ","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/02_Dashboard.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Dashboard","id":"5776754e-544f-4471-87c0-602e601fc583"},{"location":{"line":1,"column":12},"name":"@LMS","id":"b4da90a2-f63d-460f-a9b9-78fd4cadc592"},{"location":{"line":1,"column":17},"name":"@Dash","id":"340adbac-d5b7-418d-bf49-504947d1a969"}],"language":"en","keyword":"Feature","name":"Dashboard Functionality","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@Title","id":"35387c05-a092-435e-9c48-32111cf2d78f"}],"keyword":"Scenario","name":"Verify LMS title","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is on login Page","id":"d88d3b24-d752-46a7-b04a-71248b45304c"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin enter valid data in all field and clicks login button","id":"95c98cd2-9240-447f-a923-363cea2c1c41"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Admin should see LMS -Learning management system as title","id":"48a66e5e-23ba-418e-8e7a-d05f23a274ef"}],"examples":[],"id":"42762b5c-3f4b-4768-b1a2-9d616d5ee0d1"}},{"scenario":{"location":{"line":11,"column":3},"tags":[{"location":{"line":10,"column":3},"name":"@ cks login button    \r\n\r\n  Scenario: Validate headers in the program page\r\n  When Admin clicks on Program \r\n  Then Admin should see all fields and headers on Manage Program page\r\n  \r\n   Scenario: Validating the text and pagination icon in the programpage\r\n When Admin clicks on Program \r\n Then Admin should see footer and enabled pagination controls under the data table\r\n  \r\n Scenario: Verify checkbox default state beside Program Name column header\r\n When Admin clicks on Program \r\n Then Admin should see the checkbox default state\r\n\r\n  Scenario: Validate the sort icon of all the field in datatable\r\n  When Admin clicks on Program \r\n  Then Admin should see the Sort icon of all the field in the datatable.\r\n\r\n  Scenario: Validating the Delete button under the Manage program\r\n  When Admin clicks on Program \r\n  Then Admin should see the Delete button under the Manage program page header\r\n\r\n  Scenario: Validate the total no of programs in manage program page\r\n  When Admin clicks on Program \r\n  Then Admin should see Total no of programs in below of the data table\r\n  \r\n #------------------------------------------Add New Program-----------------------------------------------\r\n \r\n  Scenario Outline:  Validate Program Details Popup window\r\n    \r\n    When Admin clicks Add New Program under program navigation bar\r\n    Then Admin should see the Program Details pop up window \"<menu>\"\r\n\r\n    Examples: \r\n      | menu   |\r\n      | Name   |\r\n      | Description|\r\n      | Status |\r\n      |ProgramDetails|\r\n      \r\n    Scenario Outline: Empty form submission\r\n    When Admin clicks on save button without entering data \r\n    Then Admin should see error message below the test field and the field will be highlighed in red color \"<ProgramNameIsRequired>\" \"<DescriptionIsRequired>\" \"<StatusIsRequired>\" \r\n     Examples: \r\n      | ProgramNameIsRequired       | DescriptionIsRequired  | StatusIsRequired    |\r\n      | Program name is required | Description is required. | Status is required. |       \r\n      \r\n    Scenario Outline: Check if program is created \r\n    When Admin enters mandatory fields \"<Name>\" \"<Description>\" \"<Status>\" \"<SuccessMsg>\" in the form and clicks on save button\r\n    Then Admin gets message Class added Successfully\r\n\r\n    Examples: \r\n      | Name    || Description    || Status || SuccessMsg  |        \r\n      |TestLNGL || okkkkjh        || Active || Successful  |     \r\n      \r\n     Scenario Outline: Verify added Program is created \r\n    When Admin searches with newly created \"<Program Name>\" \r\n    Then Records of the newly created \"<Program name>\" is displayed and match the data entered\r\n    Examples:\r\n    |Program Name|\r\n    |TestLNGL|\r\n    \r\n    Scenario: Validate Cancel\/Close(X) icon on program Details form\r\n    When Admin clicks Cancel Icon on program Details form\r\n    Then Program Details popup window should be closed\r\n    \r\n #------------------------------------Edit Program -----------------------------------------------\r\n \r\n Scenario Outline:  Validate Edit Program Details Popup window\r\n    \r\n    When Admin clicks Edit New Program under program navigation bar\r\n    Then Admin should see the Program Details pop up window \"<menu>\"\r\n\r\n    Examples: \r\n      | menu   |\r\n      | Name   |\r\n      | Description|\r\n      | Status |\r\n      |ProgramDetails|\r\n \r\n \r\n  Scenario: Validate Edit icon feature\r\n    When Admin should see the Program details pop-up window by clicking the edit icon for any program\r\n    Then Admin should see the Program name field\r\n    \r\n    Scenario Outline: Check if the fields are updated with valid data\r\n    When Update the fields with valid data \"<Description>\" and click save\r\n    Then Admin gets message \"Updated program Successfully\" and see the updated values in data table\r\n\r\n    Examples: \r\n      | Description |\r\n      | Saps |\r\n      \r\n    Scenario: Validate Cancel button on Edit popup\r\n    When Admin clicks Cancel Icon on program Details form\r\n    Then Program Details popup window should be closed\r\n    \r\n     \r\n  \r\n    \r\n    \r\n #--------------------------------------------Delete-------------------------------------------------  \r\n\r\n  Scenario: Validate single row delete \r\n    When Admin should see the popup with yes or no by clicking the delete icon by from a specific program \r\n    Then The respective row in the table should be deleted\r\n    \r\n    \r\n     Scenario: Validation of No in Delete\r\n    When Admin clicks on the delete icon on program page\r\n    Then Admin should not be able to delete the program by clicking No to to go back the program page\r\n\r\n  Scenario: Validate multiple row delete with checkboxes\r\n    When Admin clicks the delete icon under the Manage program header by selecting the checkboxes for multiple program\r\n       Then The respective rows in the table should be deleted   \r\n     \r\n    \r\n    \r\n    \r\n    \r\n    \r\n#----------------------------------- Pagination -----------------------------------------------------------\r\n\r\n  Scenario Outline: Validate pagination links\r\n   When Admin clicks the <pageLink> link on the data table\r\n   Then Admin should see the <pageLink> results on the data table\r\n\r\n  Examples:\r\n     | pageLink   | results         |\r\n     | Next       |Next enabled link|\r\n     | Last       |last page link with Next disabled|\r\n     | Previous   |previous page|\r\n     | First      |very first page|\r\n     \r\n   \r\n    \r\n    \r\n\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n  ","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/03_Program.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword   When Admin Clicks on the Batch menu from the header\r\n    Then Admin should see the \"<Elements>\" on the Batch page\r\n\r\n    Examples: \r\n      | Elements                                                                                                 |\r\n      | LMS - Learning Management System                                                                         |\r\n      | Manage Batch                                                                                             |\r\n      | disabled Delete Icon under the header                                                                    |\r\n      | enabled pagination controls under the data table                                                         |\r\n      | edit icon in each data row                                                                               |\r\n      | delete icon in each data row                                                                             |\r\n      | checkbox in each data row                                                                                |\r\n      | datatable headers: Batch name, Batch Description, Batch Status, No Of classes, Program Name, Edit\/Delete |\r\n      | checkbox in the datatable header row                                                                     |\r\n      | sort icon next to all datatable headers                                                                  |\r\n\r\n  Scenario Outline: Verify sub menu displayed in batch menu bar\r\n    Given Admin is on batch page\r\n    When Admin clicks \"Add New Batch\" under batch menu bar\r\n    Then Admin should see the Batch Details pop up window \"<Menu>\"\r\n\r\n    Examples: \r\n      | Menu                      |\r\n      | Batch Name                |\r\n      | Number of classes         |\r\n      | Description as text box   |\r\n      | Program Name as drop down |\r\n      | Status as radio button    |\r\n      | Save Button               |\r\n      | Cancel Button             |\r\n      | close                     |\r\n\r\n  Scenario: Validate batchname prefix selected program name\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin selects program name present in the dropdown\r\n    Then Admin should see selected program name in the batch name prefix box\r\n\r\n  Scenario Outline: Validate batch name suffix box should accept only numbers\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters alphabets and alphanumeric and special character in \"<BatchName>\" suffix box\r\n    Then Admin should get \"<expected_message>\" below the text box of respective field\r\n\r\n    Examples: \r\n      | BatchName | expected_message                                |\r\n      | DB        | This field accept only numbers and max 5 count. |\r\n      | BG5       | This field accept only numbers and max 5 count. |\r\n      | $$        | This field accept only numbers and max 5 count. |\r\n\r\n  Scenario: Validate batch name prefix box is not editable\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters alphabets in batch name prefix box\r\n    Then Admin should see empty text box\r\n\r\n  Scenario: Validate input data only for mandatory fields\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the data only to the mandatory fields and clicks save button\r\n    Then Admin should get a successful message \"Batch created successfully\"\r\n\r\n  Scenario: validate input data missing for mandatory fields\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin leaves blank one of the mandatory fields\r\n    Then Admin should get a error message on the respective mandatory field\r\n\r\n  Scenario: validate cancel button in Batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the valid data to all the mandatory fields and click cancel button\r\n    Then Admin can see the batch details popup closes without creating any batch\r\n\r\n  Scenario: validate close icon on the batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin clicks on the close icon\r\n    Then Admin can see batch details pop up closes\r\n\r\n  Scenario: Validate Edit icon feature in any row\r\n    Given Admin is on the Batchs page\r\n    When Admin clicks the edit icon\r\n    Then Admin should see the Batch details pop up window\r\n    When Admin clicks the edit icon\r\n    Then Admin should see Program name and Batch name value field is disabled for editing\r\n    When Admin Updates any fields with invalid data and click save button\r\n    Then Admin should get a error message under the respective field\r\n    When Admin enters the valid data to all the mandatory fields and click save button\r\n    Then Admin should get a successful message for editing the batch\r\n    When Admin enters the valid data in edit btach to all the mandatory fields and click cancel button\r\n    Then Admin can see the batch details popup closes without editing the batch\r\n    When Admin enters the valid data to all the mandatory fields and click close button\r\n    Then Admin can see the batch details popup closes without editing the batch\r\n\r\n  Scenario: validate delete Icon on any row\r\n    Given Admin is on the Batchs page\r\n    When Admin clicks the delete Icon on any row\r\n    Then Admin should see the confirm alert box with yes and no button\r\n\r\n  Scenario: Validate yes button on the confirm alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the delete icon and click yes button\r\n    Then Admin should see the successful message and the batch should be deleted\r\n\r\n  Scenario: validate no button on the confirm alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the delete icon and click no button\r\n    Then Admin should see the alert box closed and the batch is not deleted\r\n\r\n  Scenario: validate close Icon on the alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the close icon on deletewindow\r\n    Then Admin should see the alert box closed\r\n\r\n  Scenario: Validate single row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the delete icon under the Manage batch header\r\n    Then Admin should see the box get highlighted\r\n    \r\n Scenario: Validate single row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin Should click the Enabled Delete icon on the header\r\n    Then Admin should see the Delete confirmation popup box\r\n    \r\n Scenario: Validate single row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the yes button\r\n    Then The respective row in the table should be deleted\r\n\r\n  Scenario: Validate multiple row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the delete icon under the Manage batch header\r\n    Then The respective row in the table should be deleted\r\n\r\n  Scenario Outline: Validate pagination links\r\n    Given Admin is on the batch page\r\n    When Admin clicks the <pageLink> link on the data table\r\n    Then Admin should see the <pageLink> results on the data table\r\n\r\n    Examples: \r\n      | pageLink | results                           |\r\n      | Next     | Next enabled link                 |\r\n      | Last     | last page link with Next disabled |\r\n      | Previous | previous page                     |\r\n      | First    | very first page                   |\r\n\r\n  Scenario: validate search box functionality\r\n    Given Admin is on the batch page\r\n    When Admin enters the batch name in the search text box\r\n    Then Admin should see the filtered batches in the data table\r\n\r\n  Scenario: Validate logout option in the header is visible and enabled from the batch page\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the logout button\r\n    Then Admin should see the Login screen Page\r\n\r\n    \r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/04_Batch.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Batch Page Navigation","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"Veryfy Admin is able to login Succesfully","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is logged into the LMS portal and on the dashboard page","id":"6888d14f-be6c-4eb6-91eb-db1df9ad36e6"}],"id":"ebe13e4d-9f9d-47b0-b3fe-f4bebd86bf5d"}},{"scenario":{"location":{"line":6,"column":3},"tags":[],"keyword":"Scenario","name":"Verify Admin Navigate to Batch page successfully","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is on LMS Homepage","id":"a6bc6852-b97f-45b3-bc49-b43a9c69e0e5"},{"location":{"line":8,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin Clicks on the Batch menu from the header","id":"86ddf336-0519-4246-b9f3-0587f27fd7ef"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Admin should be in the Manage Batch Page","id":"21cd7863-1c52-4a30-99a3-4ffe77c643c7"}],"examples":[],"id":"d9dbddca-a376-4c16-9bbe-d8250b36e610"}},{"scenario":{"location":{"line":11,"column":3},"tags":[],"keyword":"Scenario Outline","name":"Batch Page Elements Validation","description":"","steps":[{"location":{"line":12,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is on the home page","id":"97c6f787-2a2f-402e-a679-9c2e59174ddc"},{"location":{"line":13,"column":5},"keyword":"When ","keywor t button"},{"astNodeIds":["a858a3ad-2f95-4386-986f-ba6895be58cb"],"id":"bae15cb3-f9d6-4461-adb9-689e4b107089","type":"Outcome","text":"Admin should see the Login screen Page"}],"tags":[],"astNodeIds":["48e2ed44-0709-4c0b-a37c-62a170dabcca"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/05_Class.feature","data":"@Classpage @LMS\r\nFeature: Class page validation\r\n\r\nBackground: Admin Is on the Dashboard page after login\r\n  Given Admin is on login Page\r\n  When Admin enter valid data in all field and clicks login button \r\n\r\n  @ValManage\r\n  Scenario: validating the class manage page\r\n    \r\n    When admin clicks the Class Navigation bar in the Header\r\n    Then land on the Manage class page\r\n\r\n  @ValTitle\r\n  Scenario: Validating the Title in the Manage class page\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then see the LMS-Learning Management System Title\r\n\r\n  @ValHeader\r\n  Scenario: Validating the Header in the Manage class page\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then see the Manage Class Header\r\n\r\n  @ValSearch\r\n  Scenario: Validating Search bar in class page\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then Admin should see the Search Bar in Manage class page\r\n\r\n  @ValTableHeader\r\n  Scenario Outline: Validating the headers in the class page\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then Admin should see the headers heading like \"<headers>\"\r\n\r\n    Examples: \r\n      | headers                          |\r\n      | BatchName                        |\r\n      | ClassTopic                       |\r\n      | ClassDescription                 |\r\n      | Status                           |\r\n      | ClassDate                        |\r\n      | StaffName                        |\r\n      | Edit\/Del                         |\r\n\r\n  @ValDelete\r\n  Scenario: Validating the Delete button under the Manage class\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then see the Delete button under the Manage class page header.\r\n\r\n  @valNoClasses\r\n  Scenario: Validate the total no of classes in manage class page\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then see Total no of classes in below of the data table\r\n\r\n  @ValPageControls\r\n  Scenario: Validating the text and pagination icon in the classpage\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then see the pagination controls under the data table\r\n\r\n  @ValSortIcon\r\n  Scenario: Validate the sort icon of all the field in datatable\r\n  When admin clicks the Class Navigation bar in the Header\r\n    Then see the Sort icon of all the field in the datatable.\r\n    \r\n    \r\n  #Add New Class\r\n\r\n Scenario Outline:  Validate Class Details Popup window\r\n    \r\n    When Admin clicks Add New Class under class navigation bar\r\n    Then Admin should see the Class Details pop up window \"<menu>\"\r\n\r\n    Examples: \r\n      | menu                      |\r\n      | Title                     |\r\n      | BatchName                 |\r\n      | ClassTopic                |\r\n      | ClassDescription          |\r\n      | ClassDate                 |\r\n      | NoOfClasses               |\r\n      | StaffName               \t|\r\n      | Status             \t\t\t\t|\r\n      | Comments                  |\r\n      | Notes                    \t|\r\n      | Recording                 |\r\n      | Save                      |\r\n      | Cancel                    |\r\n\r\n#Add New Class POP UP\r\n\r\n# This can be scenario outline\r\nScenario: Check if class is created when only mandatory fields are entered with valid data\r\nGiven: \t\tadmin is on the home Page\r\nWhen: \t\tAdmin enters mandatory fields in the form and clicks on save button\r\nThen:  \t\tAdmin gets message Class added Successfully\r\n\r\nScenario: Check no classes value added when selecting class dates\r\nGiven: \t\tadmin is on the home Page\r\nWhen: \t\tAdmin selects class date in date picker\r\nThen:  \t\tAdmin should see no of class value is added automatically\r\n\r\nScenario: Check weekend dates are disabled in calendar\r\nGiven: \t\tAdmin is on the Class Popup window\r\nWhen: \t\tAdmin clicks date picker\r\nThen:  \t\tAdmin should see weekends dates are disabled to select\r\n\r\n\r\n\r\n\r\n\r\n  \r\n  ","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/05_Class.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Classpage","id":"0d2b77d6-85bc-4f49-9166-d5f19b471f3c"},{"location":{"line":1,"column":12},"name":"@LMS","id":"c9aebd95-b877-4db5-81c1-7afa88f18c70"}],"language":"en","keyword":"Feature","name":"Class page validation","description":"","children":[{"background":{"location":{"line":4,"column":1},"keyword":"Background","name":"Admin Is on the Dashboard page after login","description":"","steps":[{"location":{"line":5,"column":3},"keyword":"Given ","keywordType":"Context","text":"Admin is on login Page","id":"8a387811-05f7-45aa-8b56-153ad0547faf"},{"location":{"line":6,"column":3},"keyword":"When ","keywordType":"Action","text":"Admin enter valid data in all field and clicks login button","id":"592130f6-b32c-4f41-be76-ab5f402ba6e1"}],"id":"0ef559f4-c32f-4860-b67e-433a3560bc08"}},{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":8,"column":3},"name":"@ValManage","id":"a8966891-e2be-4d65-b0e4-b41728cc479f"}],"keyword":"Scenario","name":"validating the class manage page","description":"","steps":[{"location":{"line":11,"column":5},"keyword":"When ","keywordType":"Action","text":"admin clicks the Class Navigation bar in the Header","id":"d6d57747-5f94-4f2d-8e6e-59 r\n  @TextIcon\r\n  Scenario Outline: Verify section text and icon\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<section>\" text and icon\r\n\r\n    Examples: \r\n      |  section |\r\n      | User     |\r\n      | Staff    |\r\n      | Batches  |\r\n      | Programs |\r\n\r\n  @TableHeader\r\n  Scenario: Verify Staff data table header\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see Staff Data header\r\n\r\n  @ColumnHeader\r\n  Scenario Outline: Verify Staff data table column\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<section>\" column header\r\n\r\n    Examples: \r\n      | section    |\r\n      | UserID     |\r\n      | First Name |\r\n      | Last Name  |\r\n      | Phone      |\r\n      \r\n  @Home2Home\r\n  Scenario: Verify Home Link\r\n    Given Admin is on home page after Login\r\n    When Admin clicks Home menu\r\n    Then Admin should remain in the home page\r\n\r\n  @IconLink\r\n  Scenario Outline: Verify page navigation with icon\r\n    Given Admin is on home page after Login\r\n    When Admin clicks \"<module>\" icon\r\n    Then Admin should be in \"<module>\" page\r\n\r\n    Examples: \r\n      |  module  |\r\n      | User     |\r\n      | Staff    |\r\n      | Batches  |\r\n      | Programs |\r\n      \r\n  @BatchCount\r\n  Scenario: Validate batch count \r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see exact total count of active and inactive batch\r\n  \r\n  @PrgmCount\r\n  Scenario: Validate program count\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see exact total count of active and inactive program\r\n    \r\n   @UsrCount\r\n  Scenario: Validate user count\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see exact total count of active and inactive user","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/08_DashboardAdditional.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@DashboardExtra","id":"62aa35e9-ee62-4caf-ad52-8eebd29972d4"},{"location":{"line":1,"column":17},"name":"@LMS","id":"3ab5519e-b433-407c-975f-16528b8f9a0e"},{"location":{"line":1,"column":22},"name":"@Dash","id":"227e776c-e78d-4fe3-877f-bc1126d73fb8"}],"language":"en","keyword":"Feature","name":"Additional Dashboard Functionality","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":2},"name":"@LMSTitle","id":"fcc1140f-4f9b-4e94-ae3c-8ff902db221c"}],"keyword":"Scenario","name":"Verify LMS Dashboard page title","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is on login Page","id":"9c9963b1-4996-487a-b8f2-7a6fc1511edf"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin enter valid data in all field and clicks login button","id":"c4c34a7a-0242-49f2-9b07-303102a08ba6"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Admin should see LMS Dashboard page title","id":"6cb1eede-2818-4377-b1ec-d0c06c3d1158"}],"examples":[],"id":"60f91c04-a535-4802-982a-91ba7c60c491"}},{"scenario":{"location":{"line":11,"column":3},"tags":[{"location":{"line":10,"column":3},"name":"@HomeSection","id":"3ecf57aa-9b32-4b7b-bccb-1f37d3c4450f"}],"keyword":"Scenario","name":"Verify Dashboard Section","description":"","steps":[{"location":{"line":12,"column <field>\" empty and clicks save\r\n    Then Admin receives \"<field>\" mandatory error message\r\n\r\n   Examples:\r\n      | field       |\r\n      | Name        |\r\n      | Description |\r\n      | Status      |\r\n\r\n  @AddInvalidMsg\r\n  Scenario Outline: Verify field invalid message\r\n    Given The Admin is in Add New program pop window\r\n    When Admin enters invalid \"<field>\" and clicks save\r\n    Then Admin receives \"<field>\" invalid error message\r\n   Examples:\r\n      | field              |\r\n      | NameSpcChar        |\r\n      | NameStarts-SpcChar |\r\n      | NameStarts-No      |\r\n      | NamelessChar       |\r\n      | DescStarts-No      |\r\n      | DesclessChar       |\r\n\r\n    @EditMandatoryMsg\r\n  Scenario Outline: Verify field mandatory message\r\n    Given The Admin is in Edit program pop window\r\n    When Admin clears \"<field>\" and clicks save\r\n    Then Admin receives \"<field>\" edit mandatory error message\r\n\r\n   Examples:\r\n      | field       |\r\n      | Name        |\r\n      | Description |\r\n\r\n @EditInvalidMsg\r\n  Scenario Outline: Verify field invalid message\r\n    Given The Admin is in Edit program pop window\r\n    When Admin enters invalid \"<field>\" and clicks save\r\n    Then Admin receives \"<field>\" invalid error message\r\n   Examples:\r\n \r\n      | field              |\r\n      | NameSpcChar        |\r\n      | NameStarts-SpcChar |\r\n      | NameStarts-No      |\r\n      | NamelessChar       |\r\n      | DescStarts-No      |\r\n      | DesclessChar       |\r\n\r\n  @WarningSign\r\n  Scenario Outline: Verify warning sign \r\n    Given Admin is on Manage Program page\r\n    When Admin clicks on \"<icon>\" delete icon\r\n    Then Admin should see warning sign in confirmation window\r\n\r\n   Examples:\r\n \r\n      | icon       |\r\n      | Delete     |\r\n      | DeleteAll  |\r\n\r\n\r\n@PrgmNamDisplayed\r\n  Scenario: Verify selected program name Delete message\r\n    Given Admin is on Manage
